import React from 'react';
import { FlatList, StyleSheet, Text, View } from 'react-native';
import ImageDetail from '../components/ImageDetail';

const ImageScreen = () => {
  const images = [
    { title: 'Forest', imageSource: '../../assets/forest.jpg' },
    { title: 'Beach', imageSource: '../../assets/beach.jpg' },
    { title: 'Mountain', imageSource: '../../assets/mountain.jpg' },
    ];

  return (
    <View>
      <Text style={styles.headerStyle}>Image Screen</Text>
      <FlatList
        keyExtractor={card => card.title}
        data={images}
        renderItem={({item}) => <ImageDetail title={item.title} imageSource={item.imageSource} />}
      />
    </View>
  );
};

const styles = StyleSheet.create({
  headerStyle: {
    fontSize: 45,
  },
  textStyle: {
    marginVertical: 50,
    marginLeft: 15,
  },
});

export default ImageScreen;
